svg.script:

function get_xy(evt)
{
  evt.target.ownerDocument.getElementById("ball").setAttribute("cx", evt.clientX + 5);
  evt.target.ownerDocument.getElementById("ball").setAttribute("cy", evt.clientY + 5);
  Android.setXY(evt.clientX, evt.clientY)
}
function setPoint(x,y)
{
  document.getElementById("point").setAttribute("cx", x + 5);
  document.getElementById("point").setAttribute("cy", y + 5);
}
